    @Column({
        type: "timestamp"
    })
    logTimestamp: Date;

    @Column({
        type: "decimal",
        precision: 6,
        scale: 3
    })
    quantity: number;

    @Column({
        type: "text",
        nullable: true
    })
    situation?: string;

    @Column({
        type: "varchar",
        length: 256,
        nullable: true
    })
